import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';

function Layout(){
    return (
        <>
            <img src =  '/images/Logo.png' alt = "Logo" width = "449" />
            <h1>Welcome</h1>
        </>
    )
}
ReactDOM.createRoot(document.getElementById('root')).render(<Layout/>);
